import react from "react"

const navlinks = [
    {
        name: "Home",
        link: "/home",
    },
    {
        name: "About",
        link: "/about"
    },
    {
        name:"Menu",
        link:"/menu"
    },
    {
        name:"Reservations",
        link:"/reservations"
    },
    {
        name:"order",
        link:"/order"
    },

    {
        name: "Login",
        link: "/login"
    }

];

const image =[
    {
        source: "./Assets/images/Logo.png",
        name:  "Log"
    }
]

const Nav = () =>{
return (
    <nav>
        <ul>

            <li><img src={image.source} alt = {image.name}></img> </li>
            <a href= {navlinks.link}>
                <li name= {navlinks.name}>{navlinks.name}</li>
            </a>


        </ul>
    </nav>
);

};
export default Nav;
